import React, {Component} from 'react';

import './App.css'
import Context from "./Hooks/Example2";
class App extends Component {
    render() {
        return (
            <div>
                APP
                <Context/>
                <p>{Date()}</p>
                <p>
                    下面是测试关于时间
                    {Date().getDate()}
                </p>
            </div>
        );
    }
}

export default App;
